    final String name;

    if (ast.getType() == TokenTypes.CLASS_DEF) {
        name = "class def";
    }
    else if (ast.getType() == TokenTypes.ENUM_DEF) {
        name = "enum def";
    }
    else {
        name = "interface def";
    }
    return name;
}
